// src/pages/PlanChoice.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './PlanChoice.css';

function PlanChoice() {
  const navigate = useNavigate();

  return (
    <div className="plan-choice-container">
      <div className="overlay">
        <nav className="navbar">
          <div className="logo">GoGoGlobe</div>
          <div className="nav-links">
            <a href="/plans">My Plan</a>
            <a href="/logout">Sign Out</a>
          </div>
        </nav>

        <div className="choice-content">
          <h1>Ready for your next journey?</h1>
          <h2><span className="highlight">Choose your path</span> and let's get started.</h2>

          <div className="plan-choice-buttons">
            <button className="secondary-btn" onClick={() => navigate('/plans')}>
              View Existing Plans
            </button>
            <button className="primary-btn" onClick={() => navigate('/create')}>
              Start a New Plan
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default PlanChoice;
